import Rank from './Component/Rank/Rank';



class App extends React.Component{
  constructor(){
    super();
    this.state={
      input:'',
    }
  }


  render() {
  return (
    <div className="App">

      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkFrom/>
    </div>
  );
}
}

export default App;
